--TABLES
SET default_tablespace = ts_licpub_data;
SET default_with_oids = false;

--Se crea tabla consecutivo
CREATE TABLE if not exists licpub.consecutivo
(
    id_consecutivo integer NOT NULL,
    id_partida_especifica integer NOT NULL,
    cucop_plus character varying(10) NOT NULL,
    descripcion character varying(1000) NOT NULL
)TABLESPACE ts_licpub_data;

ALTER TABLE licpub.consecutivo OWNER TO licpub;

SET default_tablespace = ts_licpub_idx;

ALTER TABLE licpub.consecutivo ADD CONSTRAINT consecutivo_pkey PRIMARY KEY (id_consecutivo)
	USING INDEX TABLESPACE ts_licpub_idx;

ALTER TABLE ONLY licpub.consecutivo
    ADD CONSTRAINT consecutivo_fk FOREIGN KEY (id_partida_especifica)
    REFERENCES licpub.partida_especifica(id_partida_especifica) DEFERRABLE INITIALLY DEFERRED;

ALTER TABLE ONLY licpub.consecutivo ADD CONSTRAINT consecutivo_unique_idx UNIQUE (cucop_plus)
    USING INDEX TABLESPACE ts_licpub_idx;

